    // \uC704\uC5D0\uC11C \uC791\uC131\uD55C snippetsDir \uB514\uB809\uD1A0\uB9AC\uB97C test\uC758 output\uC73C\uB85C \uAD6C\uC131\uD558\uB294 \uC124\uC815 -&gt; \uC2A4\uB2C8\uD3AB \uC870\uAC01\uB4E4\uC774 build/generated-snippets\uB85C \uCD9C\uB825
